import React, { Component } from "react";
import "./index.scss";

class index extends Component {
  confirmAction = () => {
    // challenge is over click ok
    this.props.dismiss();
    localStorage.setItem("showGstarChallengeOverPopup", "true");
  }

  cancelAction = () => {
    // challenge is over click cancel
    this.props.dismiss();
    localStorage.setItem("showGstarChallengeOverPopup", "false");
  }

  render() {
    return (
      <div className="gstar-challenge-end-popup">
        <div className="challenge-end-popup__close-button" onClick={this.props.dismiss} />
        <p className="gstar-challenge-end-popup__title">위즈랩 X 지스타 챌린지 접수가 마감되었습니다. 감사합니다.</p>
        <div className="challenge-end-popup__buttons">
          <button onClick={this.confirmAction}>다시보지 않기</button>
          <button onClick={this.cancelAction}>닫기</button>
        </div>
      </div>
    )
  }
}

export default index;
